import React, { Component } from "react";
import Button from "@material-ui/core/Button";
import TextField from "@material-ui/core/TextField";
import Box from "@material-ui/core/Box";
import Typography from "@material-ui/core/Typography";
import Container from "@material-ui/core/Container";
import "./Profile.css";
// import accountData from "../AccountData.js";
import sign_in from "../../redux/actions.js";

class EditProfile extends Component {
  constructor(props) {
    super(props);
    this.state = {
      email: "default",
      password: "default",
      first_name: "default",
      last_name: "default",
      address: "default",
      phone_number: "default"
    };
  }
  render() {
    return (
      <Container component="main" maxWidth="xs">
        <div className="title">
          <Typography component="h1" variant="h5">
            My Account Profile
          </Typography>
          <form className="form" noValidate>
            <TextField
              fullWidth
              margin="normal"
              name="firstName"
              id="email"
              label="First Name"
              value={this.state.firstName}
              onChange={e => {
                this.setState({
                  first_name: e.target.value.toString()
                });
              }}
            />

            <TextField
              fullWidth
              margin="normal"
              name="lastName"
              id="lastName"
              label="Last Name"
              value={this.state.lastName}
              onChange={e => {
                this.setState({
                  last_name: e.target.value.toString()
                });
              }}
            />

            <TextField
              fullWidth
              margin="normal"
              name="lastName"
              id="email"
              label="First Name"
              value={this.state.lastName}
              onChange={e => {
                this.setState({
                  last_name: e.target.value.toString()
                });
              }}
            />

            <TextField
              placeholder="Last name"
              fullWidth
              margin="normal"
              name="lastName"
              value={this.state.lastName}
              onChange={e => {
                this.setState({
                  last_name: e.target.value.toString()
                });
              }}
            />

            <TextField
              type="number"
              placeholder="phone number"
              fullWidth
              margin="normal"
              name="phone number"
              value={this.state.phone_number}
              onChange={e => {
                this.setState({
                  phone_number: e.target.value.toString()
                });
              }}
            />

            <TextField
              type="text"
              placeholder="address"
              fullWidth
              margin="normal"
              name="adress"
              value={this.state.address}
              onChange={e => {
                this.setState({
                  address: e.target.value.toString()
                });
              }}
            />

            <Button
              fullWidth
              variant="contained"
              color="primary"
              className="submit"
              onClick={e => {}}
            >
              Save
            </Button>
          </form>
        </div>
        <Box mt={8}></Box>
      </Container>
    );
  }
}

const formContainer = {
  display: "flex",
  flexFlow: "row wrap"
};

export default EditProfile;
